import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.expenseOne.title}
        amount={props.expenseOne.amount}
        date={props.expenseOne.date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenseTwo.title}
        amount={props.expenseTwo.amount}
        date={props.expenseTwo.date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenseThree.title}
        amount={props.expenseThree.amount}
        date={props.expenseThree.date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenseFour.title}
        amount={props.expenseFour.amount}
        date={props.expenseFour.date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
